var _this = this;
cy.get('body').then(function ($body) {
  if ($body.find(_this.productElements.productThumbnailList).length) {
    cy.get(_this.productElements.productThumbnails).then(function ($lis) {
      var thumb;
      thumb = Math.floor(Math.random() * $lis.length);
      cy.get(_this.productElements.productThumbnailsLinks).eq(thumb).click().invoke('attr', 'href').then(function ($imagesrc) {
        cy.get(_this.productElements.mainImage).should('have.attr', 'src', $imagesrc);
      });
    });
  } else {
    cy.log('Thumbnails aren\'t available');
  }
});
